import { Dropdown } from 'react-bootstrap';
import Layout from '../Components/layout';
import {Button} from 'react-bootstrap';
import Filter from '../Components/filter'






const About = ()=> (
    <Layout>
   
    <div>
       
       <h2> You can use the below filters </h2>
       <p>Space Exploration Technologies Corp. is an American aerospace manufacturer and space transportation services company headquartered in Hawthorne, California. It was founded in 2002 by Elon Musk with the goal of reducing space transportation costs to enable the colonization of Mars.</p>
    
    <Filter/>
   
    
    </div>
  
    </Layout>
);

export default About;
